function calendario(){};
/**
 *	Iniciar configuração de Calendario
 *	@Versao 1.0.0
 *	@autor Everton Marques Cesario (everton.cesario@hotmail.com)
 *	@data 12/03/2015
 *
 *	@param {string} width largura da div Calendario ['200'] sem 'px'
 *	@param {string} exibeFechar para exibir/ocultar botão fechar ['true','false']; 
  *	@param {int} formatoCalendario altera a formatação de exibição dos campos do calendario [1,2,3];
 */
calendario.config = function (width,exibeFechar,formatoCalendario,exibeLegenda){
	tw = width.replace(/\D/g,"") != undefined || width.replace(/\D/g,"") != "" ? width.replace(/\D/g,"") : tw;
	ef = exibeFechar != undefined ? (exibeFechar != "true" ? false : true) : ef;	
	fc = formatoCalendario != undefined && parseInt(formatoCalendario) > 0 ? formatoCalendario : fc;
	el = exibeLegenda != undefined ? (exibeLegenda != "true" ? false : true) : el;
};

/**
 *	Iniciar controle de Calendario
 *	@Versao 1.0.0
 *	@autor Everton Marques Cesario (everton.cesario@hotmail.com)
 *	@data 12/03/2015
 *
 *	@param {string} id identificador do input(id);
 *	@param {string} exAno para exibir/ocultar seleção/exibição do ano no calendario ['true','false']; 
 *	@param {int} estilo altera a formatação de exibição dos campos do calendario [1,2,3];
 *	@param {array} habilita para clique apenas as datas passadas no array ["20/9/2017","18/9/2017","19/9/2017"];
 */
calendario.datepicker = function (id,exAno,estilo,datas){
	dts = datas != undefined ? datas : [];
	
	sizeOfThings();
	
	window.addEventListener('resize', function(){
	 sizeOfThings();
	});
	
	estilo = estilo != undefined && parseInt(estilo) > 0 && parseInt(estilo) <= 3 ? estilo : fc;
	
	var elemento = document.querySelector("#"+id);
	
	elemento.maxLength = (exAno.toString() == "false" ? 5 : 10);
	
	document.querySelector("body").addEventListener("click", function(e){
		verificaClickBody(e.target);
	});
	
	elemento.addEventListener("focus", function (event){
		scope = 1;
		elemento.classList.remove("ev_c_"+estilo+"_"+exAno);
		elemento.classList.add("ev_c_"+estilo+"_"+exAno);		
		d_gl = (elemento.value != "" ? parseInt(elemento.value.toString().split("/")[0]) : dt_now.getDate());
		m_gl = (elemento.value != "" ? (parseInt(elemento.value.toString().split("/")[1])-1) : dt_now.getMonth());		
		a_gl = (exAno == "false" ? 2012 : (elemento.value != "" ? elemento.value.toString().split("/")[2] : dt_now.getFullYear()));		
		iniciaCalendario(id,elemento.style.zIndex,Math.floor(elemento.offsetLeft),Math.floor(elemento.offsetTop),elemento.style.position,elemento.style.height);
	});
	
	elemento.addEventListener("blur", function (event){	
		if (document.activeElement.id != ""){
			elemento.classList.remove("ev_c_"+validaEstilo(dv)+"_"+validaClassDiv(dv).toString());			
			//removeCalendar();
		};
	});
	
	elemento.addEventListener("keyup", function (event){
		if (!/^(37|39|8)$/.test("" + event.keyCode)){
			var text_dig = elemento.value;			
			if (text_dig.length == 2){
				elemento.value = validaData(parseInt(text_dig));
			}else if(text_dig.length == 5){
				elemento.value = validaData(parseInt(text_dig.split("/")[0]), parseInt(text_dig.split("/")[1]));
			}else if(text_dig.length == 10){
				elemento.value = validaData(parseInt(text_dig.split("/")[0]), parseInt(text_dig.split("/")[1]), parseInt(text_dig.split("/")[2]));
			};
			
			elemento.value = elemento.value.replace(/\D/g,"");
			elemento.value = elemento.value.replace(/(\d{2})(\d)/,"$1/$2");
			if (exAno == "true") elemento.value = elemento.value.replace(/(\d{2})(\d)/,"$1/$2");
			
			montaCalendario((!isNaN(parseInt(elemento.value.toString().split("/")[0])) ? parseInt(elemento.value.toString().split("/")[0]) : d_gl), (!isNaN(parseInt(elemento.value.toString().split("/")[1])) ? parseInt(elemento.value.toString().split("/")[1]) : (m_gl+1)), (validaClassDiv(id) == false ? 2012 : (elemento.value.toString().split("/")[2] != undefined ? elemento.value.toString().split("/")[2] : a_gl)));						
		}else{
			event.preventDefault();
		};
	});
	
	elemento.addEventListener("contextmenu", function(e) {
		if(!e.isDefaultPrevented()){		
			e.preventDefault();
		};
	});
	
	elemento.addEventListener("change", function(e){
		elemento.value = elemento.value.replace(/\D/g,"");
		elemento.value = elemento.value.replace(/(\d{2})(\d)/,"$1/$2");
		if (exAno == "true") elemento.value = elemento.value.replace(/(\d{2})(\d)/,"$1/$2");
		elemento.value = elemento.value == "" ? "" : validaData((!isNaN(parseInt(elemento.value.toString().split("/")[0])) ? parseInt(elemento.value.toString().split("/")[0]) : d_gl), (!isNaN(parseInt(elemento.value.toString().split("/")[1])) ? parseInt(elemento.value.toString().split("/")[1]) : (m_gl+1)), (validaClassDiv(dv) == false ? undefined : (elemento.value.toString().split("/")[2] != undefined ? elemento.value.toString().split("/")[2] : a_gl)));
	});
};

function sizeOfThings(){	
	removeCalendar();
};

function validaData(dia, mes, ano){	
	if (dia != undefined){
		dia = (dia == 0 ? 1 : (dia > 31 ? 31 : dia));
	};
	
	if (mes != undefined){		
		mes = (mes == 0 ? 1 : (mes > 12 ? 12 : mes));
		var dtUltD = ultimo_dia(mes, 2012);
		dia = (dia > dtUltD ? dtUltD : dia);		
	};
	
	if (ano != undefined){		
		ano = (ano == 0 ? 1900 : ano);
		var dtUltD = ultimo_dia(mes, ano);
		dia = (dia > dtUltD ? dtUltD : dia);		
	};
	return (dia.toString().length > 1 ? dia : "0"+dia)+(mes != undefined ? ("/"+(mes.toString().length > 1 ? mes : "0"+mes)) : "")+(ano != undefined ? "/"+ano : "");
}

function verificaClickBody(elemento) { 	
	if (!elemento.classList.contains("ev_calendario_datepicker") && elemento.id != dv){
		removeCalendar();
	};  
};

function removeCalendar(){
	var dad = document.querySelector("#dt_container_ev_calendar");		
	if (dad != null){
		var rem = dad.querySelector("#ev_calendario_datepicker");	
		dad.removeChild(rem);
		dad.parentNode.removeChild(dad);
	};
}

function iniciaCalendario(id,i,l,t,p,h){
	h = h != "" ? h : 20;	
	dv = id;	
	var dataPicker = "<div id='ev_calendario_datepicker' class='ev_calendario_datepicker' style='background-color:#FFF; width: "+tw+"px; border: 1px solid #AAA; border-radius: 6px; padding: 5px; font-family: Verdana,Arial,sans-serif; z-index:999999; position:absolute; top:"+(t+(parseInt(h.toString().replace("px","")))+10)+"px; left:"+l+"px;'>";
	dataPicker += "	<div id='ev_calendario_cabecalho' class='ev_calendario_datepicker' style='width: 95%; height: 25px; border-radius: 6px; border: 1px solid #AAA; padding: 3px; background-color: #C3C3C3; color:#222'>";
	dataPicker += "		<div id='btn_left' class='ev_calendario_datepicker' style='height:100%; float: left; cursor: pointer;'><img id='seta_left' class='ev_calendario_datepicker' src='' width='98%' onmouseover=\"javaScript:overButton(this.id,'over')\" onmouseout=\"javaScript:overButton(this.id,'out')\"  onclick=\"javaScript:acaoBtn('vl')\"/></div>";
	dataPicker += "		<div id='btn_right' class='ev_calendario_datepicker' style='height:100%; float: right; cursor: pointer;'><img id='seta_right' class='ev_calendario_datepicker' src='' width='98%' onmouseover=\"javaScript:overButton(this.id,'over')\" onmouseout=\"javaScript:overButton(this.id,'out')\" onclick=\"javaScript:acaoBtn('av')\"/></div>";
	dataPicker += "		<div id='name_mes' class='ev_calendario_datepicker' style='margin:0 auto; height: 100%; cursor: pointer; font-weight: bold; text-align:center;' onclick=\"alteraScopo()\"></div>";
	dataPicker += "	</div>";
	dataPicker += "	<div id='dias_mes' class='ev_calendario_datepicker' style='text-align:center; margin: 0 auto; padding-left: 1px;'></div>";
	dataPicker += "	<div id='dv_fechar' class='ev_calendario_datepicker' style='width:98%; margin-top: -5px; display:none; border-top: 1px solid #C3C3C3; padding-left:1px;'><button id='btn_fechar' style='margin-top: 3px; border-radius:4px; padding:2px; border: 1px solid #D3D3D3; background-color:#E6E6E6; cursor:pointer;'>Fechar</button></div>";
	dataPicker += " <div id='legendas' style='margin: -5px; display: none; width: 100%; border: 1px solid #AAA; padding: 5px; background-color: #C3C3C3; color: #222; font-size: 10px; font-weight: bold;'></div>";
	dataPicker += "</div>";	
	
	removeCalendar();
	
	var x = document.createElement("div");
	x.id = "dt_container_ev_calendar";
	x.innerHTML = dataPicker;
	
	document.querySelector("body").appendChild(x);
	estruturacao();
};

function estruturacao(){	
	var ev_calendario_datepicker = document.querySelector("#ev_calendario_datepicker");
	tc = ev_calendario_datepicker.style.width.toString().replace("px","");
	wb = (tc * 10 / 100);
	tp = Math.floor(tc / 7)-2;
	
	ev_calendario_datepicker.querySelector("#ev_calendario_cabecalho #btn_left").style.width = wb+"px";
	ev_calendario_datepicker.querySelector("#ev_calendario_datepicker #ev_calendario_cabecalho #btn_right").style.width = wb+"px";
	
	ev_calendario_datepicker.style.height = wb+"px";
	ev_calendario_datepicker.querySelector("#ev_calendario_cabecalho #name_mes").style.width = (tc - (wb *2) -8)+"px";
	ev_calendario_datepicker.querySelector("#ev_calendario_cabecalho #name_mes").style.fontSize = (tc/15)+"px";
	ev_calendario_datepicker.querySelector("#dias_mes").style.width = (tc)+"px";
	ev_calendario_datepicker.querySelector("#dias_mes").style.height = (tp *7)+"px";		
	ev_calendario_datepicker.querySelector("#dv_fechar").style.display = (ef ? "block" : "none");
	ev_calendario_datepicker.style.height = ((tp *7)+wb+(ef ? 30 : 0))+"px";	
	
	ev_calendario_datepicker.querySelector("#ev_calendario_cabecalho #btn_left #seta_left").src = "data:image/png;base64,"+s4;
	ev_calendario_datepicker.querySelector("#ev_calendario_cabecalho #btn_right #seta_right").src = "data:image/png;base64,"+s2;
	
	ev_calendario_datepicker.querySelector("#dv_fechar #btn_fechar").addEventListener("mouseover", function (){
		this.style.backgroundColor = "#CECECE";
	});
	
	ev_calendario_datepicker.querySelector("#dv_fechar #btn_fechar").addEventListener("mouseout", function (){
		this.style.backgroundColor = "#E6E6E6";
	});
	
	var divV = document.querySelector("#"+dv);
	
	montaCalendario((!isNaN(parseInt(divV.value.toString().split("/")[0])) ? parseInt(divV.value.toString().split("/")[0]) : d_gl), (!isNaN(parseInt(divV.value.toString().split("/")[1])) ? parseInt(divV.value.toString().split("/")[1]) : (m_gl+1)), (validaClassDiv(dv) == false ? 2012 : (divV.value.toString().split("/")[2] != undefined ? divV.value.toString().split("/")[2] : a_gl)));
};

function montaStrutura(){	
	if (scope == 1){
		montaCalendario();
	}else if(scope ==2){
		montaMeses();
	}else if(scope ==3 && validaClassDiv(dv)){
		montaAnos();
	};
};

function acaoBtn(status){	
	if (scope == 1){		
		altera_mes(status);	
	}else if (scope == 2){
		if (status == "av"){
			a_gl ++;
		}else{
			a_gl --;
		};
		montaMeses();
	}else if (scope == 3){
		if (status == "av"){
			a_gl = parseInt(a_gl) + 12;
		}else{
			a_gl = parseInt(a_gl) - 12;
		}
		montaAnos();
	};
};

function montaAnos(){
	var tamCel = Math.floor(tc / 4)-2;
	var cale = "";
	var count = (parseInt(a_gl) -6);
	for (var i = 0; i < 4; i++){
		for (var j = 0; j < 3; j++){
			cale += "<div id='line_"+(i+1)+"_col_"+(j+1)+"' class='ev_calendario_datepicker' style='width:"+tamCel+"px; height:"+(tamCel-4)+"px; line-height:"+(tp*1.5)+"px; float:left; border: 1px solid "+(dt_now.getFullYear() == count ? "#FCEFA1" : "#C3C3C3")+"; font-size: "+(tc/15)+"px; background-color:"+(dt_now.getFullYear() == count ? "#FBF9EE" : "#EFEFEF")+"; color:#555; cursor:pointer;'"+(dt_now.getFullYear() == count ? "" : " onmouseover=\"javaScript:overTag(this.id)\" onmouseout=\"javaScript:outTag(this.id)\"")+" onclick=\"selecionaAno(this.id)\">"+count+"</div>";
			count ++;			
		};
	};
	if (document.querySelector("#ev_calendario_datepicker #ev_calendario_cabecalho #name_mes") != null){
		document.querySelector("#ev_calendario_datepicker #ev_calendario_cabecalho #name_mes").innerHTML = (parseInt(a_gl) -6)+" - "+(parseInt(a_gl) +5);		
	};
	if (document.querySelector("#ev_calendario_datepicker #dias_mes") != null){		
		document.querySelector("#ev_calendario_datepicker #dias_mes").innerHTML = cale;
	};
};

function selecionaAno(id){
	a_gl = document.querySelector("#"+id).textContent;
	scope = 2;
	montaMeses();
};

function montaMeses(){	
	var tamCel = Math.floor(tc / 4)-2;
	var cale = "";
	var count = 0;
	for (var i = 0; i < 4; i++){
		for (var j = 0; j < 3; j++){
			cale += "<div id='line_"+(i+1)+"_col_"+(j+1)+"' class='ev_calendario_datepicker' style='width:"+tamCel+"px; height:"+(tamCel-4)+"px; line-height:"+(tp*1.5)+"px; float:left; border: 1px solid "+(dt_now.getMonth() == count && dt_now.getFullYear() == a_gl ? "#FCEFA1" : "#C3C3C3")+"; font-size: "+(tc/15)+"px; background-color:"+(dt_now.getMonth() == count && dt_now.getFullYear() == a_gl ? "#FBF9EE" : "#EFEFEF")+"; color:#555; cursor:pointer;'"+(dt_now.getMonth() == count && dt_now.getFullYear() == a_gl ? "" : " onmouseover=\"javaScript:overTag(this.id)\" onmouseout=\"javaScript:outTag(this.id)\"")+" onclick=\"selecionaMes("+count+")\">"+ms[count].toString().substr(0,3).toUpperCase()+"</div>";
			count ++;			
		}
	}
	document.querySelector("#ev_calendario_datepicker #ev_calendario_cabecalho #name_mes").innerHTML = validaClassDiv(dv) ? a_gl : "Mês";
	document.querySelector("#ev_calendario_datepicker #dias_mes").innerHTML = cale;	
};

function selecionaMes(id){
	m_gl = (id+1);
	scope = 1;
	montaCalendario(0, m_gl, a_gl);
};

function overTag(div){
	document.querySelector("#"+div).style.border = '1px solid #999';
	document.querySelector("#"+div).style.backgroundColor = '#DADADA';
};

function outTag(div){	
	document.querySelector("#"+div).style.border = '1px solid #C3C3C3';
	document.querySelector("#"+div).style.backgroundColor = '#EFEFEF';
};

function montaCamposDia(){	
	var cale = preencheDiasSemana();
	for (var i = 0; i < 6; i++){
		for (var j = 0; j < 7; j++){
			cale += "<div id='line_"+(i+1)+"_col_"+(j+1)+"' class='ev_calendario_datepicker' style='width:"+tp+"px; height:"+(tp-4)+"px; float:left; border: 1px solid #C3C3C3; font-size: "+(tc/15)+"px; background-color:#"+(j == 0 ? "D3D3D3" : "EFEFEF")+"; color:#555; cursor:pointer;'></div>";
		};
	};
	
	if (document.querySelector("#ev_calendario_datepicker #dias_mes") != null){
		document.querySelector("#ev_calendario_datepicker #dias_mes").innerHTML = cale;	
	};
}

function selecionaData(id){
	d_gl = document.querySelector("#"+id).textContent;
	document.querySelector("#"+dv).value = ((d_gl.toString().length < 2 ? "0"+d_gl : d_gl)+"/"+((m_gl+1).toString().length < 2 ? "0"+(m_gl+1).toString() : (m_gl+1))+(validaClassDiv(dv) ? "/"+a_gl : ""));	
	removeCalendar();
};

function preencheDiasSemana(){
	var texto = "";		
	for (var i = 0; i < ns.length; i ++){			
		texto += "<div id='coluna"+(i+1)+"' class='ev_calendario_datepicker' style='width:"+tp+"px; height:"+tp+"px; float:left; line-height:"+tp+"px; font-size: "+(tc/14)+"px; text-align:center; border: 1px solid transparent;'><b>"+ns[i]+"</b></div>";
	};
	return texto;
};

function ultimo_dia(mes,ano){
	if(mes==1||mes==3||mes==5||mes==7||mes==8||mes==10||mes==12) return 31;
	if(mes==4||mes==6||mes==9||mes==11) return 30;
	if(mes==2) if(ano%400==0) return 29;
	if(mes==2) if(ano%100==0) return 28;	
	if(mes==2) if(ano%4==0) return 29;	else return 28; 
};

function montaCalendario(dia, mes, ano){	
	montaCamposDia();
	d_gl = dia;
	var data = (dia != undefined && mes != undefined && ano != undefined ? new Date(ano, (mes-1), 1) : (dia != undefined && mes != undefined ? new Date(2012, (mes-1), 1) : new Date()));
	var dia = data.getDate();
	var dia_sem = data.getDay();
	var mes = data.getMonth();
	var ano2 = data.getYear();
	var ano4 = data.getFullYear();
	var tz = data.getTimezoneOffset();	
	var str_data = dia + '/' + (mes+1) + '/' + ano4;

	m_gl = mes;
	a_gl = ano4;
	
	document.querySelector("#legendas").innerHTML = "";
	document.querySelector("#legendas").style.display = "none";
	
	if (document.querySelector("#ev_calendario_datepicker #ev_calendario_cabecalho #name_mes") != null){
		document.querySelector("#ev_calendario_datepicker #ev_calendario_cabecalho #name_mes").innerHTML = ms[mes]+(validaClassDiv(dv) ? " - "+ano4 : "");
	};
	
	var total_dias = ultimo_dia((mes+1), ano);
	var linha = 1;
	var coluna = (dia_sem+1);	
	var currentTime = new Date();
	
	for (var i = 1; i <= total_dias; i ++){	
		if (document.querySelector("#line_"+linha+"_col_"+coluna) != null){
			document.querySelector("#line_"+linha+"_col_"+coluna).innerHTML = i;
			if (!dts.length > 0){				
				var idss = isFeriado(i, (mes+1), ano);
				if (idss == 1){					
					document.querySelector("#line_"+linha+"_col_"+coluna).style.border = "1px solid #9e0000";
					document.querySelector("#line_"+linha+"_col_"+coluna).style.backgroundColor = "#db0000";
					document.querySelector("#line_"+linha+"_col_"+coluna).style.color = "#FFF";
				}else if (idss == 2){
					document.querySelector("#line_"+linha+"_col_"+coluna).style.border = "1px solid #995800";
					document.querySelector("#line_"+linha+"_col_"+coluna).style.backgroundColor = "#db8900";
					document.querySelector("#line_"+linha+"_col_"+coluna).style.color = "#FFF";
				}else if (comparaDatas(currentTime.getDate(), currentTime.getMonth(), ano, i, mes, ano) == 1){
					document.querySelector("#line_"+linha+"_col_"+coluna).style.border = "1px solid #2E2E2E";
					document.querySelector("#line_"+linha+"_col_"+coluna).style.backgroundColor = "#FFF";
					document.querySelector("#line_"+linha+"_col_"+coluna).style.color = "#000";
					document.querySelector("#line_"+linha+"_col_"+coluna).style.fontWeight = "bold";
				}
				document.querySelector("#line_"+linha+"_col_"+coluna).addEventListener("click", function (){
					selecionaData(this.id);
				});
			};
		};		
		
		for (var j = 0; j < dts.length; j++){			
			if (i+"/"+(mes+1)+"/"+ano4 == dts[j]){			
				document.querySelector("#line_"+linha+"_col_"+coluna).style.border = "1px solid #FCEFA1";
				document.querySelector("#line_"+linha+"_col_"+coluna).style.backgroundColor = "#FBF9EE";
				
				document.querySelector("#line_"+linha+"_col_"+coluna).addEventListener("click", function (){
					selecionaData(this.id);
				});
			};
		};
		
		if (coluna == 7){
			linha ++;
			coluna = 1;
		}else{
			coluna ++;
		};
	};
	
	if (validaEstilo(dv) > 1 && validaEstilo(dv) <= 3){
		preencheCamposVaziosOutrosMeses(m_gl,a_gl,(dia_sem+1),coluna,linha);
	};
};

function preencheCamposVaziosOutrosMeses(mes, ano, colunaIni, colunaFin, linha){	
	var m_antes = ((mes-1) == -1 ? 11 : (mes -1));
	var a_antes = ((mes-1) == -1 ? (ano -1) : ano);
	var dias_ant = ultimo_dia((m_antes+1),a_antes);	
	
	for (var i = 1; i <= (colunaIni - 1); i ++){		
		if (validaEstilo(dv) == 2){
			if (document.querySelector("#line_"+1+"_col_"+i) != null){				
				document.querySelector("#line_"+1+"_col_"+i).innerHTML = (dias_ant - (colunaIni - 1) + i);
			};
			document.querySelector("#line_"+1+"_col_"+i).style.color = "#C3C3C3";	
			if (!dts.length > 0){
				document.querySelector("#line_"+1+"_col_"+i).addEventListener("click", function() {					
					d_gl = this.textContent;
					m_gl = m_antes;
					a_gl = a_antes;			
					document.querySelector("#"+dv).value = ((d_gl.toString().length < 2 ? "0"+d_gl : d_gl)+"/"+((m_gl+1).toString().length < 2 ? "0"+(m_gl+1).toString() : (m_gl+1))+(validaClassDiv(dv) ? "/"+a_gl : ""));				
					removeCalendar();
				});
			};
		}else{
			document.querySelector("#line_"+1+"_col_"+i).style.backgroundColor = "#FFF";
			document.querySelector("#line_"+1+"_col_"+i).style.border = "1px solid transparent";
		};
	};
	
	var diasC = 0;	
	for (var i = linha; i <= 6; i ++){		
		for (var j = colunaFin; j <= 7; j++){			
			if (validaEstilo(dv) == 2){
				diasC ++;
				if (document.querySelector("#line_"+i+"_col_"+j) != null){					
					document.querySelector("#line_"+i+"_col_"+j).innerHTML = (diasC);
				};
				document.querySelector("#line_"+i+"_col_"+j).style.color = "#C3C3C3";
				document.querySelector("#line_"+i+"_col_"+j).addEventListener("click", function() {
					d_gl = this.textContent;
					m_gl = ((mes+1) == 13 ? 0 : (mes +1));
					a_gl = ((mes+1) == 13 ? (ano +1) : ano);				
					document.querySelector("#"+dv).value = ((d_gl.toString().length < 2 ? "0"+d_gl : d_gl)+"/"+((m_gl+1).toString().length < 2 ? "0"+(m_gl+1).toString() : (m_gl+1))+(validaClassDiv(dv) ? "/"+a_gl : ""));					
					removeCalendar();
				});
			}else{
				document.querySelector("#line_"+i+"_col_"+j).style.backgroundColor = "#FFF";
				document.querySelector("#line_"+i+"_col_"+j).style.border = "1px solid transparent";
			};
		};
		colunaFin = 1;
		linha++;
	};	
};

